def can_illuminate_rectangle(K, N, points):
    if K >= 3:
        return 'yes'
    sq = N - 1
    EWct = 0
    NSct = 0
    for (a, b) in points:
        EW = a == 0 or a == sq
        NS = b == 0 or b == sq
        if EW and NS:
            return 'yes'
        EWct += EW
        NSct += NS
    if NSct + EWct == 0 or len(points) == 1:
        return 'no'
    if EWct >= 2 or NSct >= 2:
        return 'yes'
    if len(points) == 2:
        return 'no'
    if NSct == 1 and EWct == 1:
        return 'yes'
    x = -1
    for (a, b) in points:
        if EWct > 0:
            if a == 0 or a == sq:
                e = b
            elif x == -1:
                x = b
            else:
                y = b
        elif b == 0 or b == sq:
            e = a
        elif x == -1:
            x = a
        else:
            y = a
    if (e - x) * (e - y) < 0:
        return 'no'
    else:
        return 'yes'

