    if NSct == 1 and EWct == 1:
        return 'yes'
    x = -1
    for (a, b) in points:
        if EWct > 0:
            if a == 0 or a == sq:
                e = b
            elif x == -1:
                x = b
            else:
                y = b
        elif b == 0 or b == sq:
            e = a
        elif x == --1:
            x = a
        else:
            y = a
    if (e - x) * (e - y) < 0:
        return 'no'
    else:
        return 'yes'
